// SPDX-License-Identifier: MIT
// Tells the Solidity compiler to compile only from v0.8.13 to v0.9.0
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

contract RailRoadCard is Ownable, ERC721Enumerable{
    using SafeMath for uint256;
	using Counters for Counters.Counter;
	uint private constant MAX_REDUCTION = 100;
	struct Collection {
		string name;
		string description;
		string imageUrl;
		uint reduction;
		uint amount;
	}
	struct Card {
		uint collectionId;
		uint tokenId;
	}
	struct SaleBundle{
		uint saleBundleId;
		uint collectionId;
		uint[] cardIds;
		uint price; //ether
		address owner;
		bool active;
		uint soldedCards;
	}
	Counters.Counter private _nextTokenId;
	Counters.Counter private _nextCollectionId;
	Counters.Counter private _nextSaleBundleId;
	mapping (uint256 => Card) private cards;
	mapping (uint256 => Collection) private collections;
	mapping (uint256 => SaleBundle) private saleBundles;
	uint[] private activeSaleBundleIds;
	uint public constant royalities = 2;

	constructor() ERC721("RailRoadCard","SRRC") {
			// TODO remove this
			// Collection memory collection = Collection("LALO SALAMANCA","pete moi le cul lalo","https://media.gqmagazine.fr/photos/5e96b6230b84640008631dd4/master/w_1920,h_1280,c_limit/20200408-saul-09.jpg",20,5);
			// createCollection(collection,0.1 ether);
			Collection memory collection2 = Collection("DON eduardo","pete moi le cul lalo","https://i.imgur.com/fL3Xq4Y.jpg",90,5);
			createCollection(collection2,10 ether);
		}

	function _mintNft(uint collectionId) private onlyOwner{
		uint tokenId = _nextTokenId.current();
		_nextTokenId.increment();
		cards[tokenId] = Card (collectionId,tokenId);
		_safeMint(address(this),tokenId);
	}

	function putCardsInSell(uint collectionId,uint[] memory cardIds,uint price) public payable {
        for (uint i = 0; i < cardIds.length; i++) {
			uint cardId = cardIds[i];
			require(ownerOf(cardId) == msg.sender," You don't own that card");
			safeTransferFrom(msg.sender,address(this),cardId);
		}
		_sell(collectionId,cardIds,price);
	}

	function _sell(uint collectionId,uint[] memory collectionCardsIds,uint price) private {
		uint saleBundleId = _nextSaleBundleId.current();
		_nextSaleBundleId.increment();
		saleBundles[saleBundleId] = SaleBundle(saleBundleId,collectionId,collectionCardsIds,price,msg.sender,true,0);
		activeSaleBundleIds.push(saleBundleId);
	}

	function onERC721Received(address, address, uint256, bytes calldata) external pure returns (bytes4) {
        return IERC721Receiver.onERC721Received.selector;
    }

	function getActiveSaleBundle() public view returns(SaleBundle[] memory) {
		SaleBundle[] memory activeSaleBundles= new SaleBundle[](activeSaleBundleIds.length);
        for (uint i = 0; i < activeSaleBundleIds.length; i++) {
			uint activeSaleBundleId = activeSaleBundleIds[i];
			SaleBundle memory saleBundle = saleBundles[activeSaleBundleId];
			if(saleBundle.active){
				activeSaleBundles[i] = saleBundle;
			}
        }
		return activeSaleBundles;
	}
	function getCollection(uint collectionId) public view returns(Collection memory) {
		return collections[collectionId];
	}

	function getReduction(address owner) public view returns(uint){
		Card[] memory ownedCards = _getOwnedCards(owner);
		uint reduction = 0;
        for (uint i = 0; i < ownedCards.length; i++) {
			uint collectionId = ownedCards[i].collectionId;
			Collection memory collection = getCollection(collectionId);
			if(collection.reduction > reduction){
				reduction = collection.reduction;
			}
		}
		return reduction;
	}
	function getReduction() public view returns(uint) {
		return getReduction(msg.sender);
	}

	function createCollection (Collection memory collection, uint price) public onlyOwner{
		require(collection.reduction <= MAX_REDUCTION,"You can't set a reduction > 100");
		uint collectionId = _nextCollectionId.current();
		_nextCollectionId.increment();
		collections[collectionId] = collection;
		uint[] memory collectionCardsIds = new uint[](collection.amount);
        for (uint i = 0; i < collection.amount; i++) {
			collectionCardsIds[i] = _nextTokenId.current();
			_mintNft(collectionId);
        }
		_sell(collectionId,collectionCardsIds,price);
	}

	function sendCards(uint[] calldata cardIds,address to) payable public{
		require( cardIds.length > 0, "Should send at least 1 card");
        for (uint i = 0; i < cardIds.length; i++) {
			uint cardIdToTransfer = cardIds[i];
			require(ownerOf(cardIdToTransfer) == msg.sender, "You don't own the card you try to send");
			safeTransferFrom(msg.sender,to,cardIdToTransfer);
        }
	}
	function buyCards(uint saleBundleId,uint count) payable public {
		require( count > 0, "Should buy at least 1 card");
		require(saleBundles[saleBundleId].active,"The provided saleBundleId doesn't exist");
		SaleBundle memory saleBundle = saleBundles[saleBundleId];
		uint cardsLefts = saleBundle.cardIds.length - saleBundle.soldedCards;
		require( count <= cardsLefts, "Not enought cards lefts");
		require( saleBundle.price <= msg.value, "too poor");
        for (uint i = saleBundle.soldedCards; i < count; i++) {
			uint cardIdToTransfer = saleBundle.cardIds[i];
			_approve(msg.sender,cardIdToTransfer);
			safeTransferFrom(address(this),msg.sender,cardIdToTransfer);
        }
		saleBundle.soldedCards += count;
		if(count == cardsLefts){
			saleBundle.active = false;
			uint newLen = activeSaleBundleIds.length - 1;
			uint[] memory updatedActiveSaleBundleIds = new uint[](newLen);
			uint indexFix = 0;
		    for (uint i = 0; i < activeSaleBundleIds.length; i++) {
				uint activeSaleBundleId = activeSaleBundleIds[i];
				if(activeSaleBundleId != saleBundleId){
					updatedActiveSaleBundleIds[i - indexFix] = activeSaleBundleId;
				}
				else{
					indexFix = 1;
				}
			}
			activeSaleBundleIds = updatedActiveSaleBundleIds;
		}
		saleBundles[saleBundleId] = saleBundle; // save the updated saleBundle
		if(saleBundle.owner == owner()){
			payable(owner()).transfer(msg.value);
		}
		else {
			uint ownerRoyalities = (msg.value * (royalities / 100)) / 100;
			payable(saleBundle.owner).transfer(msg.value-ownerRoyalities);
			payable(owner()).transfer(ownerRoyalities);
		}
	}

	function _getOwnedCards(address owner) private view returns(Card[] memory){
		uint ownedTokenIds = ERC721.balanceOf(owner);
		Card[] memory ownedCards = new Card[](ownedTokenIds); 
		for (uint i =0; i< ownedTokenIds; i++){
			uint256 ownedTokenId = tokenOfOwnerByIndex(owner,i);
			Card memory ownedCard = cards[ownedTokenId];
			ownedCards[i] = ownedCard;
		}
		return ownedCards;
	}
	function getOwnedCards() view public returns(Card[] memory) {
		return _getOwnedCards(msg.sender);
	}
}
